Sarah Michelle Prinze, (born April 14, 1977) better known by her birth name of Sarah Michelle Gellar, is an American actress. She is best known for her role as the character Buffy Summers in the acclaimed television series Buffy the Vampire Slayer, for which she won the Saturn Award for Best Genre TV Actress and received a Golden Globe Award nomination. She won a Daytime Emmy Award for her role in All My Children.
